import React from 'react';
import './CompanyLogin.css';
import {Form} from 'react-bootstrap';
import {Button} from 'react-bootstrap';


function CompanyLogin() {
    return (
        <div class='r'>
        
        
        <Form className='login col-lg-12'>
        
        <p className='welcome col-lg-12'>WELCOME TO COMPANY LOGIN</p>
        <p className='welcome col-lg-12'>You can set your own questions for the interviewees!!!</p>
        
        
        <Form.Group controlId="formBasicEmail" className='email'>
          <Form.Label>USERNAME</Form.Label>
          <Form.Control type="email" placeholder="Enter email" />
        </Form.Group>
      
        <Form.Group controlId="formBasicPassword" className='password'>
        <Form.Label>PASSWORD</Form.Label>
          <Form.Control type="password" placeholder="Password" />
       </Form.Group>
        <Button className='b' type="submit">
          SUBMIT
        </Button>
      </Form>
      </div>
    )
}

export default CompanyLogin
